import Allcards from '../components/Allcards';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

function Shop(){
    return(
        <div>
            <Navbar/>
            <h1 className='text-center mt-5'>SHOP PAGE</h1>
            <Allcards/>
            <Footer/>
        </div>
    )
}

export default Shop;
